import React from "react";

function ProductSuppImg(props) {
   return (
      <div class="profile__fotos-block">
         <img class="profile__fotos-item" src={props.imgLink} alt="" />
         <div class="profile__fotos-opacity"></div>
      </div>
   )
}
export default ProductSuppImg
